The 9th TCC (the TCC's 2nd anniversary) will take place on August 24th: lichess.org/tournament/RLQ8LoqC

I'm sad to inform my fellow three-check fanatics that this will be the last TCC organized by me. If you wish to take over the TCC series, feel free to DM me and we can talk about it. (Side note: there's no guarantee that lichess will back future TCC tournaments if you do become team leader since I'll be stepping down.)

